import React from 'react'

function Header() {
    const navbar = ["About", "Features", "Pricing", "Testimonials", "Help"]
    return (
        <div className="container max-w-3xl mx-auto pt-12 flex flex-row">
            <div>
                <h1 className="font-bold text-2xl">Landing Page</h1>
            </div>

            <div>
                {navbar.map((val,idx)=> (
                    <li key={idx}>{val}</li>
                ))}
            </div>

        </div>
    )
}

export default Header
